import React, { useState } from "react";
import Navbar from "./Components/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Components/Home";
import AllRecipes from "./Components/AllRecipes";
import CreateBlogs from "./Components/CreateBlogs";
import { fav } from "./Components/Context";
import Favorites from "./Components/Favorites";
import { button_fav } from "./Components/Context";
function App() {
  const [Fav, setfav] = useState([]);
  const [Button_Fav, setFav_Button] = useState(false);

  return (
    <>
      <div>
        <BrowserRouter>
          {" "}
          <button_fav.Provider value={{ Button_Fav, setFav_Button }}>
            {" "}
            <fav.Provider value={{ Fav, setfav }}>
              {" "}
              <Navbar />
              <Routes>
                <Route element={<Home />} path="/"></Route>
                <Route element={<AllRecipes />} path="/Recipes"></Route>
                <Route element={<CreateBlogs />} path="/Create"></Route>
                <Route element={<Favorites />} path="/favorites"></Route>
              </Routes>
            </fav.Provider>
          </button_fav.Provider>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
